import React from "react";

const CityInput = props => (
  <form>
    <input
      onChange={props.changeHandler}
      type="text"
      placeholder="where do you live?"
    />
    <button onSubmit={props.submitHandler} type="submit" value="submit">
      enter
    </button>
  </form>
);

export default CityInput;
